import React from "react";
import { useHistory } from "react-router-dom";
import logo_everis from "../Static/Img/images/logo-everis.png";
import PersonIcon from "@material-ui/icons/Person";

import ExitToAppIcon from '@material-ui/icons/ExitToApp';
const axios = require("axios");

export const NavbarComponent = () => {

  let history = useHistory();
  return (
    <>
      <nav
        class="navbar is-transparent"
        role="navigation"
        aria-label="main navigation"
      >
        <div class="navbar-brand">
          <div class="navbar-item">
            <figure class="image is-48x48">
              <img alt="everis" src={logo_everis} />
            </figure>
            <h3>Business Development</h3>
            <a
              role="button"
              class="navbar-burger burger"
              aria-label="menu"
              aria-expanded="false"
              data-target="navbarBasicExample"
            >
              <span aria-hidden="true"></span>
              <span aria-hidden="true"></span>
              <span aria-hidden="true"></span>
            </a>
          </div>
        </div>

        <div id="navbarBasicExample" class="navbar-menu">
          <div class="navbar-start">

          <div class="navbar-item has-dropdown is-hoverable">
            <a class="navbar-link">APP User Management</a>

            <div class="navbar-dropdown">
              <a class="navbar-item">Users List</a>
              <a class="navbar-item">New Users</a>
            </div>
          </div>

          <div class="navbar-item has-dropdown is-hoverable">
            <a class="navbar-link">Clients Management</a>

            <div class="navbar-dropdown">
              <a class="navbar-item">Clients List</a>
              <a class="navbar-item">New Clients</a>
            </div>
          </div>
          </div>
        </div>

        <div class="navbar-end">
        <div class="navbar-item has-dropdown is-hoverable">
            // eslint-disable-next-line jsx-a11y/anchor-is-valid
            <a className="navbar-link" href=""><PersonIcon />{" "}{sessionStorage.getItem("username").toUpperCase()}</a>

            <div className="navbar-dropdown">

              <button className="button is-white"  onClick={() =>
                      axios
                        .get(
                          `${
                            process.env.REACT_APP_API_ROOT_URL
                          }/oauth/revoke-token/${sessionStorage.getItem(
                            "username"
                          )}`,
                          {
                            headers: {
                              "Content-Type": "application/json",
                              Authorization:
                                "Bearer " +
                                sessionStorage.getItem("user_token"),
                            },
                          }
                        )
                        .then(function (response) {
                          // handle success
                        })
                        .catch(function (error) {
                          // handle error
                        })
                        .finally(function () {
                          // always executed
                          sessionStorage.removeItem("user_token");
                          history.push("/");
                        })
                    }><ExitToAppIcon />Logout</button>
            </div>
          </div>

        </div>
      </nav>
    </>
  );
};

export default NavbarComponent;
